description:
Promotional info from Comicvine - &quot;Ted McKeever's epic maxiseries (though parts 10-12 are a technically different volume; 'Metropol AD') about a walled in city's experiences in what would seem to be 'the end times'.

The plot revolved around a man named John Notochord who gets caught in a battle between Angels and Demons.&quot;

The issues marked AD complete the saga. 

This is all 12 issues of the original series and the three-issue follow-up. All scans are DCP editions; most are by eclipse with a few by bittertek. Thanks to them for their efforts; please seed and enjoy! 

